import React,{useContext,useState} from 'react'
import './withdrawModal.css'
import { useNavigate } from 'react-router-dom'
import { WithdrawState,DepositState,BalanceState } from '../App'
import { AppState} from '../App'
import WithdrawInsufficent from './WithdrawInsufficent'
import { formLabelClasses } from '@mui/material'
const WithdrawModal = ({showmodal,setModal}) => {
   const {amountDeposit} = useContext(DepositState)
    const {userInfo} = useContext(AppState)
    const {amountBalance,setBalance} = useContext(BalanceState)
    const {amountWithdraw,setWithdraw} = useContext(WithdrawState)

    const navigate = useNavigate()

    const [handleShow, setHandleShow] = useState(false)




    const Withdraw = ()=>{
         if(amountWithdraw.withdraw < 10000)
         {
              if(amountDeposit.deposit > (amountWithdraw.withdraw+50))
              {
                setBalance(amountDeposit.deposit-amountWithdraw.withdraw-50)
                setHandleShow(false)

                navigate('/dashboard/balance')
              }else{
                 setHandleShow(true)

              }  


         }else if(amountWithdraw.withdraw >= 1000 &&  amountWithdraw.withdraw < 5000)
         {  
          if(amountDeposit.deposit > (amountWithdraw.withdraw+100))
          {
            setBalance(amountDeposit.deposit - amountWithdraw.withdraw -100)
            setHandleShow(false)
            navigate('/dashboard/balance')
          }else{

            setHandleShow(true)

          }

         }else if(amountWithdraw.withdraw >= 5000 && amountWithdraw.withdraw <10000) {

          if(amountDeposit.deposit > (amountWithdraw.withdraw+180))
            {
              setBalance(amountDeposit.deposit-amountWithdraw.withdraw -180)

              navigate('/dashboard/balance')

            }else{


            }

         }else if(amountWithdraw.withdraw >= 10000 && amountWithdraw.withdraw <30000){
          if(amountDeposit.deposit > (amountWithdraw.withdraw+285))
          {
            setBalance(amountDeposit.deposit - amountWithdraw.withdraw - 285)
            setHandleShow(false)
            navigate('/dashboard/balance')
          }else
          {
            setHandleShow(true)

          }

         }else if(amountWithdraw.withdraw >= 30000 && amountWithdraw.withdraw < 100000 )
         {
          if(amountDeposit.deposit > (amountWithdraw.withdraw+500))
          {

            setBalance(amountDeposit.deposit - amountWithdraw.withdraw - 500)

            setHandleShow(formLabelClasses)
            navigate('/dashboard/balnace')


          }else{

              setHandleShow(true)
          }

         }else if (amountWithdraw.withdraw >= 100000)
         {  

          if(amountDeposit.deposit > (amountWithdraw.withdraw+1500))
                 setBalance(amountDeposit.deposit - amountWithdraw.withdraw -1500)
                setHandleShow(false)
             navigate('/dashboard/balnace')
         }else{
            setHandleShow(true)
         }

    }
   return (
    <div>
         {handleShow && <WithdrawInsufficent/>}

        <div className='withdraw'>
             <h2 className='withdraw__Title'>{userInfo.Fname} You have successfully withdraw {amountWithdraw.withdraw} </h2>

             <div className='withdraw__buttons'>
                <button className='withdraw__button1'  onClick={()=>{
                    setModal(false)

                }}>Cancel</button>
                <button className='withdraw__button2' onClick={Withdraw}>Withdraw</button>
             </div>

        </div>


    </div>
  )
}

export default WithdrawModal
